import React from 'react'
import './historia.css';

const Historia = () => {
  return (
    <div className='website__historia section__padding' id="historia">
      <div className='website__historia-content'>
        <h1>Historia</h1>
        <h2>Memoria</h2>
        <p>El Club Salvamento Arganda nace de la mano de Don Pedro Almazán Córdoba en mayo de 2006. Poco a poco se ha ido convirtiendo en una gran familia de deportistas con muchas ilusiones y sueños compartidos y que lucha para que el Salvamento y Socorrismo llegue a ser un deporte conocido.</p>
        <div className='website__historia-content-img'>

        </div>
      </div>
    </div>
  )
}

export default Historia
